import React, { Component } from 'react'
import me from './images/sitProfessional.png'

class Portrait extends Component {
    render() {
        return (
            <img
                style={{borderRadius:"5%"}}
                src={me}
                width="100%"
                height="500px"
                alt="It me"
            />
        )
    }
}

export default Portrait
